import React from "react";
import { Routes, Route } from "react-router-dom";
import Adminlogin from "./Adminlogin"; // Adjust the path as needed
import Adminhome from "./Adminhome";   // Your AdminHome component

function App() {
  return (
    <Routes>
      <Route path="/" element={<Adminlogin />} />
      <Route path="/adminhome" element={<Adminhome />} />
    </Routes>
  );
}

export default App;
